import React from 'react';
import './styles/auth-button.css';
import { $jsf } from '../JSF';
import { Link} from 'react-router-dom';

class AuthButton extends React.Component {

    inputs = {};

    componentDidMount() {
        this.inputs['name'] = $jsf(`#username`);
        this.inputs['password'] = $jsf(`#password`);
        this.inputs['email'] = $jsf(`#email`);
        this.inputs['phone'] = $jsf(`#phone`);
    }

	render() { 
        let link = '/polls/' + this.props.showRegFields ? 'newuser/' : 'olduser/';

		return <section className='authorization-confirm'>
            <Link to={link} >{this.props.showRegFields ? 'CREATE ACCOUNT' : 'CONTINUE'}</Link>
        </section>
	}
}
export { AuthButton };
